import './Profile.css';




const PostData = (props) => {
  {props.profileData.map((post) => (
    <PostData
    key={post.post_id}
    post_id={post.post_id}
    quantity={post.quantity}
    forumla_name={post.forumla_name}
    username={post.username}
    address={post.address}
    />
   ))}

